    "Improved Rhenium Thrust Chambers for In-Space Propulsion Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T20:42:28.484599",nt"name": "improved-rhenium-thrust-chambers-for-in-space-propulsion-project-0ada2",nt"isopen":
    true,nt"url": null,nt"notes": "Radiation-cooled, bipropellant thrust chambers
    are being considered fornthe ascent/descent engines and reaction control systems
    (RCS) for futurenNASA missions such as Mars Sample Return.  Currently, iridium-linednrhenium
    combustion chambers are the state-of-the-art for in-spacenengines. NASA's Advanced
    Materials Bipropellant Rocket (AMBR) engine, an150-lbf rhenium-iridium chamber produced
    by Plasma Processes, Inc. (PPI)nand Aerojet, recently set a hydrazine specific impulse
    record of 333.5nseconds.  To withstand the high loads during terrestrial launch,
    rheniumnchambers with improved mechanical properties are needed, i.e., 40ksinyield
    strength and 10&amp;#37; elongation at room temperature.  Recentnelectrochemical
    forming (EL-Form) work has shown considerable promisenfor improving the mechanical
    properties of rhenium by producing anmulti-layered deposit comprised of a tailored
    microstructure, i.e.,nEngineered Re.  In addition, the multi-component processing
    ability ofnthe EL-Form process has the potential to significantly reduce the costnof
    producing advanced rhenium-iridium thrust chambers.  Therefore, PPInand its industry
    partner, Aerojet, will work together to develop rheniumnbased in-space engines with
    improved mechanical properties at a reduced cost.",nt"license_title": "U.S.
